iscaEntries = []
chairList = []
chairWelcome1 = "Proceedings of the"
chairWelcome2 = "International Symposium on Computer Architecture"
numThreads = multiprocessing.cpu_count()
lock = threading.Lock() # for searching DBLP
# currently don't use this lock, because the insertions don't need to have a strict order
lockInsert = threading.Lock() # for inserting into shared arrays

def parallel_search(threadNum):
    threadNumStr = str(threadNum)
    
    ##print("Thread "+threadNumStr+" starting, num authors: "+str(len(iscaAuthors))+"\n")

    if (threadNum < len(iscaAuthors)):
        # write all info to a file per thread -- append for now, in case file already exists
        outFile_thr = open('/nobackup/iscaHOF/iscaHOF-thread'+threadNumStr+"-"+filename_pt2, 'a')

        # start with my thread number, increment by numThreads -- static indices per thread
        for personNum in range(threadNum, len(iscaAuthors), numThreads):
            person = iscaAuthors[personNum]
            print("Thread "+threadNumStr+": Searching DBLP for "+str(person))
            outFile_thr.write('Searching DBLP for '+str(person)+'\n')

            # the DBLP search calls and the surrounding class seem to require being called with
            # a lock, or else the calls fight each other for populating the fields
            with lock:
                currAuthors = dblp.search(person)

            numWithName = len(currAuthors)
            if (numWithName > 1):
                print("    WARNING: Thread "+threadNumStr+": "+person+" has multiple matches ("+str(numWithName)+") in DBLP")
                outFile_thr.write('    WARNING: '+person+' has multiple matches ('+str(numWithName)+') in DBLP\n')
            else:
                # if DBLP can't find any matches, print a warning so we know to check the author entry
                if (numWithName == 0):
                    outFile_thr.write('    WARNING: '+person+' has no matches in DBLP, check author name\n')

            # since we don't know which of the current authors is the "right" one, search each of them
            # for ISCA publications -- this allows multiple people with the same name to be added, and
            # ensures the "right" architect with this name is not ignored because they weren't the first
            # match
            for currAuthor in currAuthors:
                count = 0 # reset count for each person
                try:
                    numPubs = len(currAuthor.publications)
                # if accessing number of publications failed, just skip this author (or this option if multiple options with a given name)
                # so thread will proceed to next author in its partition (or not option of authors with this name)
                except:
                    outFile_thr.write("    ERROR: Thread "+threadNumStr+" can't access publications for "+person+", skipping")
                    #print("    ERROR: Thread "+threadNumStr+" can't access publications for "+person+", skipping")
                    continue;
                ##print("    Thread "+threadNumStr+": "+str(numPubs)+" DBLP entries.  ISCA publications, if any:") # DEBUG PRINT
                outFile_thr.write('    '+str(numPubs)+' DBLP entries.  ISCA publications, if any:\n') # DEBUG PRINT

                for i in range(numPubs):
                    # since the currAuthor fields are loaded lazily, need to access fields with a lock
                    with lock:
                        conf = currAuthor.publications[i].booktitle
                        title = currAuthor.publications[i].title
                        year = currAuthor.publications[i].year
                        pages = currAuthor.publications[i].pages

                    if (conf == "ISCA"):
                        # The Chair's Welcome is flagged as an ISCA publication, and the title is always "Proceedings of the ..."
                        # or "International Symposium on Computer Architecture ..."
                        # So exclude any matches with this title (hopefully no one named their paper this ...)
                        if (not(chairWelcome1 in title) and not(chairWelcome2 in title)):
                            # some prior versions of ISCA have single page 'abstracts' or keynote 
                            # talks that DBLP shows as papers.  To check for these, look at how
                            # many pages they are -- these abstracts/keynotes are always 1 page
                            # In comparison, non-abstract/keynote papers have a dash in them because
                            # they are multiple pages
                            if ("-" in pages):
                                count = count + 1
                                outFile_thr.write('        '+str(count)+'. '+conf+' '+str(year)+': '+title+'\n')
                            else:
                                ##print("        Thread "+threadNumStr+": Ignoring "+conf+" "+str(year)+": "+title+", seems to be a keynote or abstract")
                                outFile_thr.write('        Ignoring '+conf+' '+str(year)+': '+title+', seems to be a keynote or abstract\n')
                        # separately track the chairs
                        elif ((chairWelcome1 in title) or (chairWelcome2 in title)):
                            chairTuple = (person, year)
                            #with lockInsert:
                            chairList.insert(0, chairTuple)

                if (count > 0):
                    print("    Thread "+threadNumStr+": Total ISCA publications: "+str(count)) # DEBUG PRINT
                outFile_thr.write('    Total ISCA publications: '+str(count)+'\n') # DEBUG PRINT

                # just create a separate script to print out all entries for each person (or grab from debug prints above), instead of complicating data structures here
                authorTuple = (person, count)
                # insert people likely to not be in HOF at the end, to reduce number of swaps a little
                if (count >= 1 and count < 8):
                    #with lockInsert:
                    iscaEntries.append(authorTuple)
                # just insert at beginning of list if in HOF -- likely to be towards beginning
                elif (count >= 8):
                    #with lockInsert:
                    iscaEntries.insert(0, authorTuple)
                # if no ISCA publications, don't insert them

                count = 0 # reset count for each person
                outFile_thr.flush()
        outFile_thr.close()

##print("Main    : before creating thread, numThreads: "+str(numThreads))
threads = list()
for i in range(numThreads):
    ##print("Main    : create and start thread "+str(i))
    x = threading.Thread(target=parallel_search, args=(i,))
    threads.append(x)
    x.start()

# now that all authors are added, create final lists
for i, thread in enumerate(threads):
    ##print("Main    : before joining thread "+str(i))
    thread.join()
